import React from 'react';

const UserIcon = ({ className, width = 22, height = 21 }) => (
  <svg 
    className={`user-icon ${className || ''}`}
    width={width}
    height={height}
    viewBox="0 0 22 21"
    fill="none"
    xmlns="http://www.w3.org/2000/svg"
  >
    <circle cx="11" cy="7" r="4" stroke="currentColor" strokeWidth="1.5"/>
    <path d="M4 18c0-4 3-6 7-6s7 2 7 6" stroke="currentColor" strokeWidth="1.5" strokeLinecap="round"/>
  </svg>
);

export default UserIcon;
